.clearCatcher {
  fill-opacity: 0;
}
p {
  font-size: 20px;
  font-weight: bold;
}
p em {
  background: yellow;
  padding: 5px;
}
table {
  cursor: default;
  border-spacing: 0;
  padding-top: 0px;
  width: 100%;
  table-layout: fixed;
  position: relative;
  word-wrap: break-word;
  overflow-x: scroll;
}
td {
  text-align: center;
  background-color: white;
  border: 1px solid;
  border-color: black;
  z-index: 0;
}
th {
  border-color: black;
}
svg {
  cursor: default;
}
.container {
  position: relative;
  overflow: auto;
  width: 100%;
}
.sharedAxis {
  border-top: 2px solid;
  position: absolute;
  top: 0px;
  z-index: 4;
  padding: 0;
}
.headerCol {
  border: 2px solid;
  left: 0;
  position: sticky;
  z-index: 3;
  background: white;
  height: min-content !important;
}
.headerRowCells {
  padding: 0;
  position: sticky;
  top: 0;
  background: white;
  border: 1px solid;
  z-index: 20;
  font-weight: inherit;
  border-top: 3px solid;
}
th#topLeft {
  z-index: 30;
  background-color: white;
  padding: 0;
  position: sticky;
  top: 0;
  background: white;
  left: 0;
  border-top: 0;
  border-left: 0;
  border-bottom: 0;
}
#headColCover {
  position: fixed;
  left: 0px;
  border-color: white;
  background-color: white;
  border-left: 2px solid;
  color: white !important;
  z-index: 2;
}
.placeholder td {
  background-color: white;
  color: white;
}
#graph {
  z-index: 4;
}
.container::-webkit-scrollbar {
  width: 5px;
  height: 5px;
}
.container::-webkit-scrollbar-thumb {
  border-radius: 2.5px;
  opacity: 0.4;
  background-color: #868686;
}
.hide {
  visibility: hidden;
}
.gone {
  display: none;
}


